import axios from "axios";


const state = {
    // toggleDrawer: true,
    allEvents: []
};

const mutations = {
    //setDrawer: (state) => state.toggleDrawer = !state.toggleDrawer,
    // setDrawer(state){
    //     state.toggleDrawer = !state.toggleDrawer
    //     state.miniDrawer = !state.miniDrawer
    // }

    getAllCommissions: (state, events) => state.allEvents = events 
};

const actions = {
    async getAllCommissions({commit})
    {
        const response = await axios.get("https://localhost:44389/api/Commission/allCommissions")
        commit('getEvents', response.data)
    }
};

const getters = {
    
};

export default {
    namespaced: true,
    state,
    getters,
    actions,
    mutations
};
